import React from 'react';
import { Breadcrumbs, Link, Button } from '@material-ui/core';
// import PropTypes from 'prop-types'
// import { Link } from "react-router-dom";

export const Header = (props) => {
    let mystyle = {
        display: 'flex',
        justifyContent: 'center',
    }
    let linkstyle = {
        textDecoration: 'none',
        padding: '10px'
    }
    let div = {
        display: 'inline-block',
        right: '20px',
        float: 'right'
    }
    function handleClick(event) {
        event.preventDefault();
        console.info('You clicked a breadcrumb.');
    }
    return (
        <>
            {/* <img src="../public/etarkimg.png" style={mystyle} alt="logo" /> */}
            <nav style={mystyle}>
                
                    <Link color="inherit" href="/"  aria-current="page" style={linkstyle}>
                        HOW TO USE
                    </Link>
                    <Link color="inherit" href="/getting-started/installation/" aria-current="page"style={linkstyle}>
                        ABOUT US
                    </Link>
                    <Link
                        color="textPrimary"
                        href="/components/breadcrumbs/"
                        style={linkstyle}
                        aria-current="page"
                    >
                        CONTACT US
                    </Link>

                <div style={div}>
                <Link color="inherit" href="/getting-started/installation/" aria-current="page"style={linkstyle}>
                        LOGIN
                    </Link>
                <Button variant="contained" color="primary">
                    Get Started
                </Button>
                </div>
            </nav>
        </>
    )
}
